	// AJAX PORTFOLIO DETAILS
	var pActive;

	function showProjectDetails(url) {

		showLoader();

		var p = $('.p-overlay:not(.active)').first();
		pActive = $('.p-overlay.active');

		if(pActive.length) {
			hideProjectDetails();
		}

		// ajax : fill data
		p.empty().load(url + ' .portfolio-single', function() {
			NProgress.set(0.5);

			// wait for images to be loaded
			p.imagesLoaded(function() {

				hideLoader();

				$('html').addClass('p-overlay-on');

				$("body").scrollTop(0);

				// setup plugins
				setup();

				if(Modernizr.csstransforms && Modernizr.csstransforms3d) { // modern browser
				p.removeClass('animated '+ outAnimation + " " + inAnimation ).addClass('animated '+ inAnimation).show();
				} else { //old browser
					p.fadeIn();
				}
				p.addClass('active');

			});
		});
	}

	function hideProjectDetails(forever, safeClose) {

		$("body").scrollTop(0);

		// close completely by back link.
		if(forever) {
			pActive = $('.p-overlay.active');

			$('html').removeClass('p-overlay-on');

			if(!safeClose) {
				// remove detail url
				$.address.path(portfolioKeyword);
			}
		}

		pActive.removeClass('active');

		if(Modernizr.csstransforms && Modernizr.csstransforms3d) { // modern browser
			pActive.removeClass('animated '+ inAnimation).addClass('animated '+ outAnimation);
			setTimeout(function() { pActive.hide().removeClass(outAnimation).empty(); } ,1010)
		} else { //old browser
			pActive.fadeOut().empty();
		}
	}

	function giveDetailUrl() {

		var address = $.address.value();
		var detailUrl;

		if (address && portfolioKeyword && address.indexOf("/"+ portfolioKeyword + "/")!=-1 && address.length > portfolioKeyword.length + 2 ) {
			var total = address.length;
			detailUrl = address.slice(portfolioKeyword.length+2,total);
		} else {
			detailUrl = -1;
		}
		return detailUrl;
	}
